#include <bits/stdc++.h>
using namespace std;

int N, Gmax;
int V[1001], G[1001];
int dp[1001][10001]; // dp[n][g] = valoarea maxima pentru n obiecte cu greutatea totala (maxima) g
// pentru reconstruire, se va folosi inca o matrice care memoreaza obiectul cu care s-a ajuns la dp[n][g]
int dp2[1001][10001];
int main()
{
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    cout.tie(nullptr);

    cin >> N >> Gmax;
    for(int i = 1; i <= N; i++)
        cin >> G[i] >> V[i];
    for(int i = 1; i <= N; i++)
    {
        for(int g = 0; g <= Gmax; g++)
        {
            if(g - G[i] < 0)
            {
                dp[i][g] = dp[i - 1][g];
                dp2[i][g] = dp2[i - 1][g];
            }
            else
            {
                if (dp[i - 1][g - G[i]] + V[i] > dp[i - 1][g])
                {
                    dp[i][g] = dp[i - 1][g - G[i]] + V[i];
                    dp2[i][g] = i;
                }
                else
                {
                    dp[i][g] = dp[i-1][g];
                    dp2[i][g] = dp2[i-1][g];
                }
            }
        }
    }
    // reconstruire
    int i = dp2[N][Gmax], g = Gmax;
    while(i != 0)
    {
        cout << i << ' ';
        g -= G[i];
        i = dp2[N-1][g];
    }
    cout << endl << dp[N][Gmax];
    return 0;
}

